INSERT INTO `EntitiesRelation` VALUES (1, 'the PhotoTask object', 'contains', 'an ImageView', 'Move data to the UI', 'https://developer.android.com/training/multiple-threads/communicate-ui.html', 'If the status code is TASK_COMPLETE , then the task is finished, and the PhotoTask object in the Message contains both a Bitmap and an ImageView.', '11162', '11162_40', '11162_40_3');
INSERT INTO `EntitiesRelation` VALUES (2, 'The sync adapter framework', 'runs', 'onPerformSync', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'Note: The sync adapter framework runs onPerformSync() on a background thread, so you don\'t have to set up your own background processing.', '11224', '11224_52', '11224_52_1');
INSERT INTO `EntitiesRelation` VALUES (3, 'Android Auto', 'uses', 'the MediaSession.Callback class', 'Implement play commands', 'https://developer.android.com/training/auto/audio/index.html', 'When an Android Auto user requests playback of an audio track from your app, Android Auto uses the MediaSession.Callback class from your app\'s MediaSession object, which it obtained from your app\'s media browse service.', '11027', '11027_118', '11027_118_2');
INSERT INTO `EntitiesRelation` VALUES (4, 'the current Fragment', 'is', 'the OnItemClickListener', 'Initialize the loader', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', 'For example: Since you specified that the current Fragment is the OnItemClickListener for the ListView , you now need to implement its required method onItemClick() , which handles the click event.', '11078', '11078_51', '11078_51_1');
INSERT INTO `EntitiesRelation` VALUES (5, 'the OnboardingFragment', 'appears', 'the first time', 'Introducing First-time Users to Your App', 'https://developer.android.com/training/tv/playback/onboarding.html', 'To ensure that the OnboardingFragment only appears the first time that the user starts your app, use a SharedPreferences object to track whether the user has already viewed the OnboardingFragment.', '11276', '11276_21', '11276_21_1');
INSERT INTO `EntitiesRelation` VALUES (6, 'The v17 Leanback support library', 'provides', 'the OnboardingFragment class', 'Customize Page Animations', 'https://developer.android.com/training/tv/playback/onboarding.html', 'The v17 Leanback support library provides the OnboardingFragment class for presenting first-time user information.', '11276', '11276_8', '11276_8_1');
INSERT INTO `EntitiesRelation` VALUES (7, 'AA', 'will be full of', 'gradually-increasing integers', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'At the end of execution, AA and BB will be full of gradually-increasing integers.', '11020', '11020_501', '11020_501_3');
INSERT INTO `EntitiesRelation` VALUES (8, 'The BroadcastReceiver', 'processes', 'Intent objects', 'Receive Status Broadcasts from an IntentService', 'https://developer.android.com/training/run-background-service/report-status.html', 'The BroadcastReceiver for an Activity receives and processes Intent objects even when your app is in the background, but doesn\'t force your app to the foreground.', '11192', '11192_25', '11192_25_2');
INSERT INTO `EntitiesRelation` VALUES (9, 'data', 'is', 'a Uri', 'Build an Implicit Intent', 'https://developer.android.com/training/basics/intents/sending.html', 'If your data is a Uri , there\'s a simple Intent() constructor you can use to define the action and data.', '11052', '11052_17', '11052_17_1');
INSERT INTO `EntitiesRelation` VALUES (10, 'users', 'click', 'the QuickContactBadge icon', 'Displaying the Quick Contact Badge', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'For example: When users click the QuickContactBadge icon, the contact\'s details automatically appear in the dialog.', '11074', '11074_31', '11074_31_1');
INSERT INTO `EntitiesRelation` VALUES (11, 'the Activity', 'displays', 'the list', 'Sharing a File', 'https://developer.android.com/training/secure-file-sharing/share-file.html', 'Since the Activity displays the list of available files in a ListView , when the user clicks a file name the system calls the method onItemClick() , in which you can get the selected file.', '11210', '11210_19', '11210_19_1');
INSERT INTO `EntitiesRelation` VALUES (12, 'Any OnboardingFragment implementation', 'must use', 'a theme', 'Introducing First-time Users to Your App', 'https://developer.android.com/training/tv/playback/onboarding.html', 'Any OnboardingFragment implementation must use either the Theme_Leanback_Onboarding theme or a theme that inherits from Theme_Leanback_Onboarding.', '11276', '11276_65', '11276_65_2');
INSERT INTO `EntitiesRelation` VALUES (13, 'The TvInputService.Session', 'notifies', 'the system TV app', 'Declare your TV input service in the manifest', 'https://developer.android.com/training/tv/tif/tvinput.html', 'The TvInputService.Session handles the onTune() event when the user selects a channel, and notifies the system TV app for changes in the content and content metadata.', '11289', '11289_89', '11289_89_3');
INSERT INTO `EntitiesRelation` VALUES (14, 'A Tutorial', 'is', 'a good place', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Shared Memory Consistency Models: A Tutorial Written in 1995 by Adve & Gharachorloo, this is a good place to start if you want to dive more deeply into memory consistency models.', '11020', '11020_557', '11020_557_1');
INSERT INTO `EntitiesRelation` VALUES (15, 'The UnreadConversation object', 'include', 'a RemoteInput object', 'Concepts and objects', 'https://developer.android.com/training/auto/messaging/index.html', 'The UnreadConversation object you create must also include a RemoteInput object.', '11028', '11028_110', '11028_110_1');
INSERT INTO `EntitiesRelation` VALUES (16, 'An OnboardingFragment', 'displays', 'content', 'Add an Initial Logo Screen', 'https://developer.android.com/training/tv/playback/onboarding.html', 'An OnboardingFragment displays content in a series of ordered pages.', '11276', '11276_27', '11276_27_1');
INSERT INTO `EntitiesRelation` VALUES (17, 'the query results', 'are stored in', 'a PurchasesResult object', 'Query purchased items', 'https://developer.android.com/training/play-billing-library/purchase-iab-products.html', 'The following sample code illustrates how you can query purchased items from the BillingManager class: If the query is successful, the query results are stored in a PurchasesResult object.', '11184', '11184_32', '11184_32_1');
INSERT INTO `EntitiesRelation` VALUES (18, 'activity', 'was started with', 'startActivity', 'Add an Intent Filter', 'https://developer.android.com/training/basics/intents/filters.html', 'Note: There\'s no need to check whether your activity was started with startActivity() or startActivityForResult().', '11049', '11049_48', '11049_48_1');
INSERT INTO `EntitiesRelation` VALUES (19, 'every hour', 'use', 'setRepeating', 'Decide how precise your alarm needs to be', 'https://developer.android.com/training/scheduling/alarms.html', 'For the rare app that has rigid time requirements for example, the alarm needs to fire precisely at 8:30 a.m., and every hour on the hour thereafter use setRepeating().', '11199', '11199_88', '11199_88_1');
INSERT INTO `EntitiesRelation` VALUES (20, 'Android Auto', 'calls', 'app \'s MediaBrowserService', 'Building your content hierarchy', 'https://developer.android.com/training/auto/audio/index.html', 'Android Auto, when acting as an audio client, calls your app\'s MediaBrowserService to find out what content you have available.', '11027', '11027_85', '11027_85_1');
INSERT INTO `EntitiesRelation` VALUES (21, 'Android Auto', 'calls', 'app \'s MediaBrowserService', 'Build a Browser Service', 'https://developer.android.com/training/auto/audio/index.html', 'Android Auto, when acting as an audio client, calls your app\'s MediaBrowserService to find out what content you have available.', '11027', '11027_85', '11027_85_1');
INSERT INTO `EntitiesRelation` VALUES (22, 'onView', 'does not find', 'the target view', 'Checking data loading in adapter views', 'https://developer.android.com/training/testing/espresso/basics.html', 'If onView() does not find the target view, a NoMatchingViewException is thrown.', '11240', '11240_97', '11240_97_1');
INSERT INTO `EntitiesRelation` VALUES (23, 'Any OnboardingFragment implementation', 'must use', 'a theme', 'Customize Themes', 'https://developer.android.com/training/tv/playback/onboarding.html', 'Any OnboardingFragment implementation must use either the Theme_Leanback_Onboarding theme or a theme that inherits from Theme_Leanback_Onboarding.', '11276', '11276_65', '11276_65_2');
INSERT INTO `EntitiesRelation` VALUES (24, 'app', 'use', 'the active CameraCaptureSession', 'Trigger an image capture', 'https://developer.android.com/things/training/doorbell/camera-input.html', 'Your app can now use the active CameraCaptureSession to request image data from the camera hardware.', '10895', '10895_29', '10895_29_1');
INSERT INTO `EntitiesRelation` VALUES (25, 'Thumbnail', 'Add', 'a QuickContactBadge', 'Set the Contact URI and Thumbnail', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'Add a QuickContactBadge View Set the Contact URI and Thumbnail Add a QuickContactBadge to a ListView You should also read.', '11074', '11074_1', '11074_1_2');
INSERT INTO `EntitiesRelation` VALUES (26, 'CardView widgets', 'are', 'part', 'Add Dependencies', 'https://developer.android.com/training/material/lists-cards.html', 'The RecyclerView and CardView widgets are part of the v7 Support Libraries.', '11148', '11148_45', '11148_45_2');
INSERT INTO `EntitiesRelation` VALUES (27, 'The following example code', 'populate', 'a projection transformation Matrix', 'Define a Projection', 'https://developer.android.com/training/graphics/opengl/projection.html', 'The following example code takes the height and width of the GLSurfaceView and uses it to populate a projection transformation Matrix using the Matrix.frustumM() method: This code populates a projection matrix, mProjectionMatrix which you can then combine with a camera view transformation in the onDrawFrame() method, which is shown in the next section.', '11110', '11110_15', '11110_15_3');
INSERT INTO `EntitiesRelation` VALUES (28, 'the website owner', 'published', 'valid assetlinks.json files', 'Request App Links Verification', 'https://developer.android.com/training/app-links/index.html', 'For example, an app with the following intent filter declaration would pass verification only if the website owner published valid assetlinks.json files at both https://www.example.com/.well-known/assetlinks.json and https://mobile.example.com/.well-known/assetlinks.json : Declare Website Associations.', '11002', '11002_48', '11002_48_2');
INSERT INTO `EntitiesRelation` VALUES (29, 'the service', 'extends', 'IntentService', 'Define an intent service to fetch the address', 'https://developer.android.com/training/location/display-address.html', 'Because the service extends IntentService , it shuts down automatically after all intents are processed.', '11136', '11136_72', '11136_72_1');
INSERT INTO `EntitiesRelation` VALUES (30, 'An Intent', 'start', 'a specific component', 'Interacting with Other Apps', 'https://developer.android.com/training/basics/intents/index.html', 'An Intent can be explicit in order to start a specific component (a specific Activity instance) or implicit in order to start any component that can handle the intended action (such as \"capture a photo\").', '11050', '11050_9', '11050_9_1');
INSERT INTO `EntitiesRelation` VALUES (31, 'two Scene objects', 'are', 'the app', 'Create a Scene From a Layout Resource', 'https://developer.android.com/training/transitions/scenes.html', 'The following code snippet shows you how to get a reference to the scene root and create two Scene objects from the layout files: In the app, there are now two Scene objects based on view hierarchies.', '11262', '11262_32', '11262_32_1');
INSERT INTO `EntitiesRelation` VALUES (32, 'Java memory model web site', 'has', 'a few test programs', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Bill Pugh s Java memory model web site has a few test programs on it.', '11020', '11020_494', '11020_494_1');
INSERT INTO `EntitiesRelation` VALUES (33, 'A Handler object', 'receives', 'messages', 'Send status up the object hierarchy', 'https://developer.android.com/training/multiple-threads/communicate-ui.html', 'A Handler object receives messages and runs code to handle the messages.', '11162', '11162_13', '11162_13_1');
INSERT INTO `EntitiesRelation` VALUES (34, 'an IntentService', 'Define', 'the IntentService', 'Creating a Background Service', 'https://developer.android.com/training/run-background-service/create-service.html', 'Create an IntentService Define the IntentService in the Manifest You should also read.', '11190', '11190_1', '11190_1_1');
INSERT INTO `EntitiesRelation` VALUES (35, 'the Activity', 'displays', 'the list', 'Create a File Selection Activity', 'https://developer.android.com/training/secure-file-sharing/share-file.html', 'Since the Activity displays the list of available files in a ListView , when the user clicks a file name the system calls the method onItemClick() , in which you can get the selected file.', '11210', '11210_19', '11210_19_1');
INSERT INTO `EntitiesRelation` VALUES (36, 'The button', 'has', 'a unique R.id', 'View assertion simple test', 'https://developer.android.com/training/testing/espresso/basics.html', 'The button in the SimpleActivity has a unique R.id , as expected.', '11240', '11240_66', '11240_66_1');
INSERT INTO `EntitiesRelation` VALUES (37, 'Thread objects', 'are controlled by', 'the system', 'Interrupt Running Code', 'https://developer.android.com/training/multiple-threads/run-code.html', 'Notice that Thread objects are controlled by the system, which can modify them outside of your app\'s process.', '11166', '11166_21', '11166_21_1');
INSERT INTO `EntitiesRelation` VALUES (38, 'the activity', 'overrides', 'onProvideAssistContent', 'Source app', 'https://developer.android.com/training/articles/assistant.html', 'To provide activity-specific contextual information, the activity overrides onProvideAssistData() and onProvideAssistContent().', '11008', '11008_25', '11008_25_2');
