INSERT INTO `EntitiesRelation` VALUES (334, 'AndroidKeyStore', 'is registered as', 'a KeyStore type', 'Working with Keystore Entries', 'https://developer.android.com/training/articles/keystore.html', 'AndroidKeyStore is registered as a KeyStore type for use with the KeyStore.getInstance(type) method and as a provider for use with the KeyPairGenerator.getInstance(algorithm, provider) and KeyGenerator.getInstance(algorithm, provider) methods.', '11010', '11010_43', '11010_43_1');
INSERT INTO `EntitiesRelation` VALUES (335, 'An OnboardingFragment', 'displays', 'content', 'Add OnboardingFragment Pages', 'https://developer.android.com/training/tv/playback/onboarding.html', 'An OnboardingFragment displays content in a series of ordered pages.', '11276', '11276_27', '11276_27_1');
INSERT INTO `EntitiesRelation` VALUES (336, 'The Wearable UI Library', 'includes', 'the WearableRecyclerView class', 'Adding a Circular Scrolling Gesture', 'https://developer.android.com/training/wearables/ui/lists.html', 'The Wearable UI Library includes the WearableRecyclerView class, which is a RecyclerView implementation for creating lists optimized for wearable devices.', '11325', '11325_4', '11325_4_1');
INSERT INTO `EntitiesRelation` VALUES (337, 'ComplicationProviderInfo class', 'will be included in', 'the case', 'Opening the provider chooser', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'In the case where a provider was set, ComplicationProviderInfo class for the chosen provider will be included in the data intent of the result, as an extra with the key ProviderChooserIntent#EXTRA_PROVIDER_INFO.', '11332', '11332_82', '11332_82_1');
INSERT INTO `EntitiesRelation` VALUES (338, 'the SearchView widget', 'implements', 'an action view', 'Action Views and Action Providers', 'https://developer.android.com/training/appbar/action-views.html', 'For example, the SearchView widget implements an action view for entering search queries, and the ShareActionProvider widget implements an action provider for sharing information with other apps.', '11003', '11003_10', '11003_10_1');
INSERT INTO `EntitiesRelation` VALUES (339, 'Android 4.4 Immersive Mode Android', 'introduces', 'a new SYSTEM_UI_FLAG_IMMERSIVE flag', 'Choose an Approach', 'https://developer.android.com/training/system-ui/immersive.html', 'DevBytes: Android 4.4 Immersive Mode Android 4.4 (API Level 19) introduces a new SYSTEM_UI_FLAG_IMMERSIVE flag for setSystemUiVisibility() that lets your app go truly \"full screen.\" This flag, when combined with the SYSTEM_UI_FLAG_HIDE_NAVIGATION and SYSTEM_UI_FLAG_FULLSCREEN flags, hides the navigation and status bars and lets your app capture all touch events on the screen.', '11228', '11228_5', '11228_5_1');
INSERT INTO `EntitiesRelation` VALUES (340, 'A RequestQueue', 'needs', 'two things', 'Use a Singleton Pattern', 'https://developer.android.com/training/volley/requestqueue.html', 'A RequestQueue needs two things to do its job: a network to perform transport of the requests, and a cache to handle caching.', '11294', '11294_6', '11294_6_1');
INSERT INTO `EntitiesRelation` VALUES (341, 'The APIs', 'are available in', 'the android.database.sqlite package', 'Saving Data in SQL Databases', 'https://developer.android.com/training/basics/data-storage/databases.html', 'The APIs you\'ll need to use a database on Android are available in the android.database.sqlite package.', '11036', '11036_5', '11036_5_1');
INSERT INTO `EntitiesRelation` VALUES (342, 'Paint', 'defines', 'font', 'Create Drawing Objects', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'Simply put, Canvas defines shapes that you can draw on the screen, while Paint defines the color, style, font, and so forth of each shape you draw.', '11080', '11080_19', '11080_19_3');
INSERT INTO `EntitiesRelation` VALUES (343, 'The following example', 'creates', 'an ImageButton', 'Set up the Zoom Animation', 'https://developer.android.com/training/animation/zoom.html', 'The following example creates an ImageButton for clickable image thumbnail and an ImageView that displays the enlarged view of the image: Set up the Zoom Animation.', '10998', '10998_8', '10998_8_1');
INSERT INTO `EntitiesRelation` VALUES (344, 'A QuickContactBadge', 'is', 'a widget', 'Set up a custom CursorAdapter', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'A QuickContactBadge is a widget that initially appears as a thumbnail image.', '11074', '11074_5', '11074_5_1');
INSERT INTO `EntitiesRelation` VALUES (345, 'The TextPaint object', 'defines', 'color', 'Rendering complications', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'The TextPaint object defines the font, text size, color, and more.', '11332', '11332_47', '11332_47_2');
INSERT INTO `EntitiesRelation` VALUES (346, 'The Android way', 'is to invoke', 'an Intent', 'Get the Thumbnail', 'https://developer.android.com/training/camera/photobasics.html', 'The Android way of delegating actions to other applications is to invoke an Intent that describes what you want done.', '11067', '11067_17', '11067_17_1');
INSERT INTO `EntitiesRelation` VALUES (347, 'A WakefulBroadcastReceiver', 'passes', 'the work', 'Using WakefulBroadcastReceiver', 'https://developer.android.com/training/scheduling/wakelock.html', 'A WakefulBroadcastReceiver passes off the work to a Service (typically an IntentService ), while ensuring that the device does not go back to sleep in the transition.', '11201', '11201_38', '11201_38_1');
INSERT INTO `EntitiesRelation` VALUES (348, 'Binary data', 'is shared using', 'the ACTION_SEND action', 'Send Binary Content', 'https://developer.android.com/training/sharing/send.html', 'Binary data is shared using the ACTION_SEND action combined with setting the appropriate MIME type and placing the URI to the data in an extra named EXTRA_STREAM.', '11213', '11213_26', '11213_26_1');
INSERT INTO `EntitiesRelation` VALUES (349, 'the content URI', 'does n\'t contain', 'the MediaStore authority value', 'Determine the content provider', 'https://developer.android.com/training/beam-files/receive-files.html', 'In this case, the content URI doesn\'t contain the MediaStore authority value, and the content URI usually doesn\'t point to a directory.', '11063', '11063_40', '11063_40_1');
INSERT INTO `EntitiesRelation` VALUES (350, 'the sync adapter framework', 'calls', 'the following arguments', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'To facilitate the transfer of data from your main app code to the sync adapter component, the sync adapter framework calls onPerformSync() with the following arguments: Account An Account object associated with the event that triggered the sync adapter.', '11224', '11224_30', '11224_30_1');
INSERT INTO `EntitiesRelation` VALUES (351, 'The Palette object', 'gives', 'access', 'Selecting Colors with the Palette API', 'https://developer.android.com/training/material/palette-colors.html', 'The Palette object gives you access to the colors in a Bitmap image while also providing six main color profiles from the bitmap to help inform your design choices.', '11149', '11149_7', '11149_7_1');
INSERT INTO `EntitiesRelation` VALUES (352, 'The InputManagerCompat interface', 'provides', 'the following methods', 'Implement the Interface on Android 4.1 and Higher', 'https://developer.android.com/training/game-controllers/compatibility.html', 'The InputManagerCompat interface provides the following methods: getInputDevice() Mirrors getInputDevice().', '11095', '11095_42', '11095_42_1');
INSERT INTO `EntitiesRelation` VALUES (353, 'An IntentService', 'send', 'a broadcast intent', 'Handle Geofence Transitions', 'https://developer.android.com/training/location/geofencing.html', 'An IntentService can post a notification, do long-running background work, send intents to other services, or send a broadcast intent.', '11137', '11137_37', '11137_37_4');
INSERT INTO `EntitiesRelation` VALUES (354, 'the startActivityForResult', 'is protected by', 'a condition', 'Take a Photo with the Camera App', 'https://developer.android.com/training/camera/photobasics.html', 'Notice that the startActivityForResult() method is protected by a condition that calls resolveActivity() , which returns the first activity component that can handle the intent.', '11067', '11067_20', '11067_20_1');
INSERT INTO `EntitiesRelation` VALUES (355, 'a camera app', 'might list', 'READ_CONTACTS', 'Don\'t Overwhelm the User', 'https://developer.android.com/training/permissions/usage-notes.html', 'For example, a camera app might list CAMERA , READ_CONTACTS , and ACCESS_FINE_LOCATION in its manifest.', '11180', '11180_72', '11180_72_2');
INSERT INTO `EntitiesRelation` VALUES (356, 'The RecyclerView', 'are', 'part', 'Create Lists', 'https://developer.android.com/training/material/lists-cards.html', 'The RecyclerView and CardView widgets are part of the v7 Support Libraries.', '11148', '11148_45', '11148_45_1');
INSERT INTO `EntitiesRelation` VALUES (357, 'SimpleActivity', 'contains', 'a Spinner', 'Adapter view simple test', 'https://developer.android.com/training/testing/espresso/basics.html', 'SimpleActivity contains a Spinner with a few items that represent types of coffee beverages.', '11240', '11240_82', '11240_82_1');
INSERT INTO `EntitiesRelation` VALUES (358, 'An InputStream', 'is', 'a readable source', 'Using HttpsUrlConnection to Fetch Data', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'An InputStream is a readable source of bytes.', '11053', '11053_33', '11053_33_1');
INSERT INTO `EntitiesRelation` VALUES (359, 'PieChart', 'make', 'the pie', 'Draw!', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'In this implementation, PieChart attempts to make its area big enough to make the pie as big as its label: There are three important things to note in this code:.', '11080', '11080_40', '11080_40_2');
INSERT INTO `EntitiesRelation` VALUES (360, 'The system TV app', 'sends', 'the TvInputManager interface', 'Define your TV input service', 'https://developer.android.com/training/tv/tif/tvinput.html', 'The system TV app sends requests to TV input services via the TvInputManager interface.', '11289', '11289_23', '11289_23_2');
INSERT INTO `EntitiesRelation` VALUES (361, 'A QuickContactBadge', 'is', 'a widget', 'Set the Contact URI', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'A QuickContactBadge is a widget that initially appears as a thumbnail image.', '11074', '11074_5', '11074_5_1');
INSERT INTO `EntitiesRelation` VALUES (362, 'the PieChart class', 'reads', 'attributes', 'Add Properties and Events', 'https://developer.android.com/training/custom-views/create-view.html', 'Here\'s how the PieChart class reads its attributes: Note that TypedArray objects are a shared resource and must be recycled after use.', '11079', '11079_48', '11079_48_2');
INSERT INTO `EntitiesRelation` VALUES (363, 'onDraw', 'are', 'some common operations', 'Draw!', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'Every view implements onDraw() differently, but there are some common operations that most views share:.', '11080', '11080_51', '11080_51_1');
INSERT INTO `EntitiesRelation` VALUES (364, 'The collapseActionView attribute', 'allows', 'SearchView', 'Add the Search View to the App Bar', 'https://developer.android.com/training/search/setup.html', 'The collapseActionView attribute allows your SearchView to expand to take up the whole app bar and collapse back down into a normal app bar item when not in use.', '11205', '11205_10', '11205_10_1');
INSERT INTO `EntitiesRelation` VALUES (365, 'the Activity', 'extends', 'the notification', 'Set Up a Regular Activity PendingIntent', 'https://developer.android.com/training/notify-user/navigation.html', 'In a sense, the Activity extends the notification by providing information that would be hard to display in the notification itself.', '11176', '11176_7', '11176_7_1');
INSERT INTO `EntitiesRelation` VALUES (366, 'the client app', 'calls', 'startActivityForResult', 'Send a Request for the File', 'https://developer.android.com/training/secure-file-sharing/request-file.html', 'To request a file from the server app, the client app calls startActivityForResult with an Intent containing the action such as ACTION_PICK and a MIME type that the client app can handle.', '11207', '11207_8', '11207_8_1');
INSERT INTO `EntitiesRelation` VALUES (367, 'the value', 'can get', 'SIZE', 'Retrieve a File\'s Name and Size', 'https://developer.android.com/training/secure-file-sharing/retrieve-info.html', 'SIZE The size of the file in bytes, as a long This value is the same as the value returned by File.length() The client app can get both the DISPLAY_NAME and SIZE for a file by setting all of the arguments of query() to null except for the content URI.', '11208', '11208_15', '11208_15_3');
INSERT INTO `EntitiesRelation` VALUES (368, 'the current Fragment', 'is', 'the OnItemClickListener', 'Initialize the Fragment', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', 'For example: Since you specified that the current Fragment is the OnItemClickListener for the ListView , you now need to implement its required method onItemClick() , which handles the click event.', '11078', '11078_51', '11078_51_1');
INSERT INTO `EntitiesRelation` VALUES (369, 'This XML', 'uses', 'the built-in Android ListView widget android', 'Match a Contact by Name and List the Results', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', 'For example, you could create the main layout file res/layout/contacts_list_view.xml with the following XML: This XML uses the built-in Android ListView widget android:id/list.', '11078', '11078_21', '11078_21_1');
INSERT INTO `EntitiesRelation` VALUES (370, 'the code', 'uses', 'a CursorLoader', 'Retrieving a List of Contacts', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', 'To use this class, include the following statement: Since the code uses a CursorLoader to retrieve data from the provider, you must specify that it implements the loader interface LoaderManager.LoaderCallbacks.', '11078', '11078_34', '11078_34_1');
INSERT INTO `EntitiesRelation` VALUES (371, 'AA', 'are', 'ordinary integer arrays', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Where a and b are declared as volatile int fields, and AA and BB are ordinary integer arrays.', '11020', '11020_498', '11020_498_1');
INSERT INTO `EntitiesRelation` VALUES (372, 'A DataItem', 'defines', 'the data interface', 'Syncing Data Items', 'https://developer.android.com/training/wearables/data-layer/data-items.html', 'Sync Data with a Data Map Listen for Data Item Events A DataItem defines the data interface that the system uses to synchronize data between handhelds and wearables.', '11311', '11311_1', '11311_1_1');
INSERT INTO `EntitiesRelation` VALUES (373, 'the ImageView', 'sets', 'visibility', 'Create the Views', 'https://developer.android.com/training/animation/zoom.html', 'When clicked, the ImageView minimizes back down to the size of the image thumbnail and sets its visibility to GONE to hide it.', '10998', '10998_22', '10998_22_1');
INSERT INTO `EntitiesRelation` VALUES (374, 'Binder', 'are not declared within', 'the application', 'Using interprocess communication', 'https://developer.android.com/training/articles/security-tips.html', 'Binder and Messenger objects are not declared within the application manifest, and therefore you cannot apply declarative permissions directly to them.', '11019', '11019_232', '11019_232_1');
INSERT INTO `EntitiesRelation` VALUES (375, 'The RecyclerView class', 'simplifies', 'handling', 'Animations', 'https://developer.android.com/training/material/lists-cards.html', 'The RecyclerView class simplifies the display and handling of large data sets by providing:.', '11148', '11148_8', '11148_8_2');
INSERT INTO `EntitiesRelation` VALUES (376, 'the channel', 'works with', 'program information presenter', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'To make sure the channel and program information works with the system TV app\'s channel and program information presenter, follow the guidelines below.', '11285', '11285_20', '11285_20_5');
INSERT INTO `EntitiesRelation` VALUES (377, 'the Android print framework', 'calls', 'method', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'When it is time to write print output to a file, the Android print framework calls the onWrite() method of your application\'s PrintDocumentAdapter class.', '11186', '11186_49', '11186_49_1');
INSERT INTO `EntitiesRelation` VALUES (378, 'ViewPager s', 'can animate', 'screen slides', 'Add a ViewPager', 'https://developer.android.com/training/animation/screen-slide.html', 'ViewPager s can animate screen slides automatically.', '10997', '10997_4', '10997_4_1');
INSERT INTO `EntitiesRelation` VALUES (379, 'channel metadata', 'map', 'the values', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'Pull your channel metadata (in XML, JSON, or whatever) from your backend server, and in your setup activity map the values to the system database as follows: In the example above, channel is an object which holds channel metadata from the backend server.', '11285', '11285_17', '11285_17_6');
INSERT INTO `EntitiesRelation` VALUES (380, 'FindClass', 'finds', 'the ClassLoader object', 'Native Libraries', 'https://developer.android.com/training/articles/perf-jni.html', 'FindClass finds the ClassLoader object associated with the Foo class and uses that.', '11012', '11012_239', '11012_239_1');
INSERT INTO `EntitiesRelation` VALUES (381, 'the SwipeRefreshLayout Widget', 'Add', 'a Refresh Action', 'Adding Swipe-to-Refresh To Your App', 'https://developer.android.com/training/swipe/add-swipe-interface.html', 'Add the SwipeRefreshLayout Widget Add a Refresh Action to the Action Bar You should also read.', '11219', '11219_1', '11219_1_1');
INSERT INTO `EntitiesRelation` VALUES (382, 'a magazine', 'use', 'the IMMERSIVE flag', 'Use Sticky Immersion', 'https://developer.android.com/training/system-ui/immersive.html', 'If you\'re building a book reader, news reader, or a magazine, use the IMMERSIVE flag in conjunction with SYSTEM_UI_FLAG_FULLSCREEN and SYSTEM_UI_FLAG_HIDE_NAVIGATION.', '11228', '11228_35', '11228_35_2');
INSERT INTO `EntitiesRelation` VALUES (383, 'the system', 'calls', 'the onDraw', 'Draw your watch face', 'https://developer.android.com/training/wearables/watch-faces/drawing.html', 'When the timer ticks, the handler calls the invalidate() method and the system then calls the onDraw() method to redraw the watch face.', '11335', '11335_28', '11335_28_3');
INSERT INTO `EntitiesRelation` VALUES (384, 'a Palette object', 'contains', '16 primary colors', 'Generate a Palette instance', 'https://developer.android.com/training/material/palette-colors.html', 'By default, a Palette object contains 16 primary colors from a given image.', '11149', '11149_41', '11149_41_1');
INSERT INTO `EntitiesRelation` VALUES (385, 'that vol2', 'was set in', 'thread', 'What not to do in Java', 'https://developer.android.com/training/articles/smp.html', 'You d have to know that vol2 was set after data1/data2 in thread 1.', '11020', '11020_442', '11020_442_2');
INSERT INTO `EntitiesRelation` VALUES (386, 'an onView', 'throws', 'a NoMatchingViewException', 'Adapter view warnings', 'https://developer.android.com/training/testing/espresso/basics.html', 'When an onView() operation throws a NoMatchingViewException and AdapterView widgets are present in the view hierarchy, the most common solution is to use onData().', '11240', '11240_104', '11240_104_1');
INSERT INTO `EntitiesRelation` VALUES (387, 'the user', 'has triggered', 'a TAP_TYPE_TOUCH_CANCEL event', 'Handle gestures', 'https://developer.android.com/training/wearables/watch-faces/interacting.html', 'Once the user has triggered a TAP_TYPE_TOUCH_CANCEL event, they cannot trigger a TAP_TYPE_TAP event until they make a new contact with the screen.', '11337', '11337_26', '11337_26_1');
INSERT INTO `EntitiesRelation` VALUES (388, 'CardView widgets', 'can have', 'rounded corners', 'Create Cards', 'https://developer.android.com/training/material/lists-cards.html', 'CardView widgets can have shadows and rounded corners.', '11148', '11148_35', '11148_35_2');
INSERT INTO `EntitiesRelation` VALUES (389, 'a volatile declaration', 'was about as weak as', 'C counterpart', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'As defined in the specification for Java 1.4 and earlier, a volatile declaration was about as weak as its C counterpart.', '11020', '11020_390', '11020_390_1');
INSERT INTO `EntitiesRelation` VALUES (390, 'ARM doesn t', 'provide', 'a wide variety', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Because of this, and because ARM doesn t provide a wide variety of barrier choices, many atomic primitives use full barrier instructions when a barrier is required.', '11020', '11020_226', '11020_226_1');
INSERT INTO `EntitiesRelation` VALUES (391, 'A Presenter', 'binds', 'objects', 'Create a Card View', 'https://developer.android.com/training/tv/playback/card.html', 'A Presenter generates views and binds objects to them on demand.', '11271', '11271_12', '11271_12_2');
INSERT INTO `EntitiesRelation` VALUES (392, 'the system', 'assumes as', 'GestureDetector.SimpleOnGestureListener', 'Detecting All Supported Gestures', 'https://developer.android.com/training/gestures/detector.html', 'If you return false from onDown() , as GestureDetector.SimpleOnGestureListener does by default, the system assumes that you want to ignore the rest of the gesture, and the other methods of GestureDetector.OnGestureListener never get called.', '11099', '11099_53', '11099_53_1');
INSERT INTO `EntitiesRelation` VALUES (393, 'an Android Auto user requests playback', 'uses', 'the MediaSession.Callback class', 'Parse the voice query to build the playback queue', 'https://developer.android.com/training/auto/audio/index.html', 'When an Android Auto user requests playback of an audio track from your app, Android Auto uses the MediaSession.Callback class from your app\'s MediaSession object, which it obtained from your app\'s media browse service.', '11027', '11027_118', '11027_118_1');
INSERT INTO `EntitiesRelation` VALUES (394, 'weak global references', 'be passed to', 'NewGlobalRef', 'jclass', 'jmethodID', 'Until Android 4.0 (Ice Cream Sandwich), weak global references could only be passed to NewLocalRef , NewGlobalRef , and DeleteWeakGlobalRef.', '11012', '11012_195', '11012_195_3');
INSERT INTO `EntitiesRelation` VALUES (395, 'The ImageCardView class', 'displays', 'an image', 'Providing a Card View', 'https://developer.android.com/training/tv/playback/card.html', 'The ImageCardView class used in this lesson displays an image for the content along with the media item\'s title.', '11271', '11271_6', '11271_6_1');
INSERT INTO `EntitiesRelation` VALUES (396, 'method', 'returns', 'the inflated View', 'Load the ViewStub Layout', 'https://developer.android.com/training/improving-layouts/loading-ondemand.html', 'Note: The inflate() method returns the inflated View once complete.', '11121', '11121_15', '11121_15_1');
INSERT INTO `EntitiesRelation` VALUES (397, 'Binary data', 'is shared using', 'the ACTION_SEND action', 'Send Text Content', 'https://developer.android.com/training/sharing/send.html', 'Binary data is shared using the ACTION_SEND action combined with setting the appropriate MIME type and placing the URI to the data in an extra named EXTRA_STREAM.', '11213', '11213_26', '11213_26_1');
INSERT INTO `EntitiesRelation` VALUES (398, 'MainActivity.java', 'Define', 'Transition Lifecycle Callbacks', 'Specify Multiple Transitions', 'https://developer.android.com/training/transitions/transitions.html', 'The first snippet shows the layout definition file: res/layout/activity_main.xml The next snippet shows the code that animates the addition of the text view: MainActivity.java Define Transition Lifecycle Callbacks.', '11263', '11263_71', '11263_71_3');
INSERT INTO `EntitiesRelation` VALUES (399, 'ArticleFragment', 'reused', 'the activity layout', 'Reuse Fragments in Other Activities', 'https://developer.android.com/training/multiscreen/adaptui.html', 'For example, ArticleFragment is used in the dual-pane layout: And reused (without a layout) in the activity layout for smaller screens ( ArticleActivity ): Naturally, this has the same effect as declaring the fragment in an XML layout, but in this case an XML layout is unnecessary work because the article fragment is the only component of this activity.', '11167', '11167_19', '11167_19_6');
INSERT INTO `EntitiesRelation` VALUES (400, 'GestureDetector.SimpleOnGestureListener', 'provides', 'an implementation', 'Detecting All Supported Gestures', 'https://developer.android.com/training/gestures/detector.html', 'GestureDetector.SimpleOnGestureListener provides an implementation for all of the on <TouchEvent> methods by returning false for all of them.', '11099', '11099_48', '11099_48_1');
INSERT INTO `EntitiesRelation` VALUES (401, 'the search dialog', 'fires', 'the ACTION_SEARCH intent', 'Handle Search Terms', 'https://developer.android.com/training/tv/discovery/searchable.html', 'As soon as the search dialog has a word which matches the value in one of your app\'s columns (described in Identifying Columns , above), the system fires the ACTION_SEARCH intent.', '11268', '11268_70', '11268_70_2');
INSERT INTO `EntitiesRelation` VALUES (402, 'thread', 'writes to', 'a volatile field', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'If thread 1 writes to a volatile field, and thread 2 subsequently reads from that same field, then thread 2 is guaranteed to see that write and all writes previously made by thread 1.', '11020', '11020_393', '11020_393_1');
INSERT INTO `EntitiesRelation` VALUES (403, 'the handler', 'calls', 'the invalidate', 'Respond to changes between modes', 'https://developer.android.com/training/wearables/watch-faces/drawing.html', 'When the timer ticks, the handler calls the invalidate() method and the system then calls the onDraw() method to redraw the watch face.', '11335', '11335_28', '11335_28_1');
INSERT INTO `EntitiesRelation` VALUES (404, 'the string', 'contains', 'the error message', 'Return the address to the requestor', 'https://developer.android.com/training/location/display-address.html', 'In the case of a failure, the string contains the error message, as shown in this code sample: Return the address to the requestor.', '11136', '11136_60', '11136_60_1');
INSERT INTO `EntitiesRelation` VALUES (405, 'app', 'must extend', 'the abstract MediaSession.Callback class', 'Enable Playback Control', 'https://developer.android.com/training/auto/audio/index.html', 'To handle content playback, your app must extend the abstract MediaSession.Callback class and implement the methods that your app supports.', '11027', '11027_120', '11027_120_1');
INSERT INTO `EntitiesRelation` VALUES (406, 'The UI Automator testing framework', 'works with', 'the AndroidJUnitRunner test runner', 'Create a UI Automator Test Class', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'The UI Automator testing framework is an instrumentation-based API and works with the AndroidJUnitRunner test runner.', '11255', '11255_13', '11255_13_2');
INSERT INTO `EntitiesRelation` VALUES (407, 'The Android platform', 'includes', 'the HttpsURLConnection client', 'Using HttpsUrlConnection to Fetch Data', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'The Android platform includes the HttpsURLConnection client, which supports TLS, streaming uploads and downloads, configurable timeouts, IPv6, and connection pooling.', '11053', '11053_12', '11053_12_1');
