INSERT INTO `EntitiesRelation` VALUES (411, 'Activity', 'is in', 'focus', 'Testing UI for Multiple Apps', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'The UI Automator APIs let you interact with visible elements on a device, regardless of which Activity is in focus.', '11255', '11255_10', '11255_10_1');
INSERT INTO `EntitiesRelation` VALUES (412, 'A BroadcastReceiver', 'handles', 'asynchronous requests', 'Using broadcast receivers', 'https://developer.android.com/training/articles/security-tips.html', 'A BroadcastReceiver handles asynchronous requests initiated by an Intent.', '11019', '11019_242', '11019_242_1');
INSERT INTO `EntitiesRelation` VALUES (413, 'IMMERSIVE', 'is', 'a good option', 'Use Sticky Immersion', 'https://developer.android.com/training/system-ui/immersive.html', 'Because users may want to access the action bar and other UI controls somewhat frequently, but not be bothered with any UI elements while flipping through content, IMMERSIVE is a good option for this use case.', '11228', '11228_36', '11228_36_1');
INSERT INTO `EntitiesRelation` VALUES (414, 'InputManagerCompatV16', 'is', 'an implementation', 'Implement the Interface on Android 4.1 and Higher', 'https://developer.android.com/training/game-controllers/compatibility.html', 'InputManagerCompatV16 is an implementation of the InputManagerCompat interface that proxies method calls to an actual InputManager and InputManager.InputDeviceListener.', '11095', '11095_63', '11095_63_1');
INSERT INTO `EntitiesRelation` VALUES (415, 'StackOverflowXmlParser', 'populates', 'a List', 'Read the Feed', 'https://developer.android.com/training/basics/network-ops/xml.html', 'StackOverflowXmlParser populates a List of entries with data from the feed.', '11057', '11057_87', '11057_87_1');
INSERT INTO `EntitiesRelation` VALUES (416, 'the listener', 'passed', 'an IabResult object', 'Initiate a Connection with Google Play', 'https://developer.android.com/training/in-app-billing/preparing-iab-app.html', 'If the API version is not supported, or if an error occurs while establishing the service binding, the listener is notified and passed an IabResult object with the error message.', '11127', '11127_68', '11127_68_1');
INSERT INTO `EntitiesRelation` VALUES (417, 'InputDeviceListener', 'Mirrors', 'the InputManager.InputDeviceListener interface', 'Implement the Interface on Android 4.1 and Higher', 'https://developer.android.com/training/game-controllers/compatibility.html', 'InputDeviceListener Mirrors the InputManager.InputDeviceListener interface.', '11095', '11095_55', '11095_55_1');
INSERT INTO `EntitiesRelation` VALUES (418, 'This method', 'returns', 'a VerifyAppsUserResult object', 'Determine whether app verification is enabled', 'https://developer.android.com/training/safetynet/verify-apps.html', 'This method returns a VerifyAppsUserResult object, which contains information regarding all actions that the user has taken related to the Verify Apps feature, including enabling it.', '11198', '11198_28', '11198_28_1');
INSERT INTO `EntitiesRelation` VALUES (419, 'circular scrolling', 'is disabled in', 'the WearableRecyclerView', 'Creating Lists', 'https://developer.android.com/training/wearables/ui/lists.html', 'By default, circular scrolling is disabled in the WearableRecyclerView.', '11325', '11325_28', '11325_28_2');
INSERT INTO `EntitiesRelation` VALUES (420, 'A GLSurfaceView', 'is', 'a specialized view', 'Building an OpenGL ES Environment', 'https://developer.android.com/training/graphics/opengl/environment.html', 'A GLSurfaceView is a specialized view where you can draw OpenGL ES graphics.', '11107', '11107_22', '11107_22_1');
INSERT INTO `EntitiesRelation` VALUES (421, 'Descendant navigation', 'is often implemented using', 'an Intent', 'Implement Master/Detail Flows Across Handsets and Tablets', 'https://developer.android.com/training/implementing-navigation/descendant.html', 'Descendant navigation in this case is often implemented using an Intent that starts an activity representing the detail screen.', '11115', '11115_12', '11115_12_1');
INSERT INTO `EntitiesRelation` VALUES (422, 'application', 'is not using', 'a WebView', 'Load an HTML Document', 'https://developer.android.com/training/printing/html-docs.html', 'However, if your application is not using a WebView , you can create an instance of the class specifically for printing purposes.', '11187', '11187_10', '11187_10_1');
INSERT INTO `EntitiesRelation` VALUES (423, 'The InteractiveChart sample', 'display', 'glow', 'Animating a Scroll Gesture', 'https://developer.android.com/training/gestures/scroll.html', 'The InteractiveChart sample uses the EdgeEffect class (actually the EdgeEffectCompat class) to display a \"glow\" effect when users reach the content edges.', '11104', '11104_10', '11104_10_2');
INSERT INTO `EntitiesRelation` VALUES (424, 'A LinearLayout', 'handled as', 'a compound drawable', 'Revise Your Layout', 'https://developer.android.com/training/improving-layouts/optimizing-layout.html', 'Use compound drawables - A LinearLayout which contains an ImageView and a TextView can be more efficiently handled as a compound drawable.', '11122', '11122_38', '11122_38_1');
INSERT INTO `EntitiesRelation` VALUES (425, 'the first step', 'is to add', 'the WAKE_LOCK permission', 'Keep the CPU On', 'https://developer.android.com/training/scheduling/wakelock.html', 'To use a wake lock, the first step is to add the WAKE_LOCK permission to your application\'s manifest file: If your app includes a broadcast receiver that uses a service to do some work, you can manage your wake lock through a WakefulBroadcastReceiver , as described in Using a WakefulBroadcastReceiver.', '11201', '11201_30', '11201_30_1');
INSERT INTO `EntitiesRelation` VALUES (426, 'a view', 'calls', 'requestLayout', 'Do Less', 'Less Frequently', 'Any time a view calls requestLayout() , the Android UI system needs to traverse the entire view hierarchy to find out how big each view needs to be.', '11083', '11083_14', '11083_14_1');
INSERT INTO `EntitiesRelation` VALUES (427, 'The UI Automator testing framework', 'works with', 'the AndroidJUnitRunner test runner', 'Testing UI for Multiple Apps', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'The UI Automator testing framework is an instrumentation-based API and works with the AndroidJUnitRunner test runner.', '11255', '11255_13', '11255_13_2');
INSERT INTO `EntitiesRelation` VALUES (428, 'The RecyclerView widget', 'is', 'flexible version', 'Create Lists', 'https://developer.android.com/training/material/lists-cards.html', 'The RecyclerView widget is a more advanced and flexible version of ListView.', '11148', '11148_5', '11148_5_1');
INSERT INTO `EntitiesRelation` VALUES (429, 'The next step', 'is to handle', 'the incoming broadcast Intent objects', 'Report Status From an IntentService', 'https://developer.android.com/training/run-background-service/report-status.html', 'For example: The next step is to handle the incoming broadcast Intent objects in the component that sent the original work request.', '11192', '11192_13', '11192_13_1');
INSERT INTO `EntitiesRelation` VALUES (430, 'PieChart', 'exposes', 'a property', 'Add Properties and Events', 'https://developer.android.com/training/custom-views/create-view.html', 'The following snippet shows how PieChart exposes a property called showText : Notice that setShowText calls invalidate() and requestLayout().', '11079', '11079_52', '11079_52_1');
INSERT INTO `EntitiesRelation` VALUES (431, 'The v17 Leanback support library', 'provides', 'the OnboardingFragment class', 'Add OnboardingFragment Pages', 'https://developer.android.com/training/tv/playback/onboarding.html', 'The v17 Leanback support library provides the OnboardingFragment class for presenting first-time user information.', '11276', '11276_8', '11276_8_1');
INSERT INTO `EntitiesRelation` VALUES (432, 'the ad_id column', 'could be joined in', 'this example', 'Working with Advertising IDs', 'https://developer.android.com/training/articles/user-data-ids.html', 'In this example, the ad_id column could be joined to PII via the account_id column in both tables, which would be a violation of the Google Play Developer Content Policy , if you did not get explicit permission from your users.', '11021', '11021_38', '11021_38_1');
INSERT INTO `EntitiesRelation` VALUES (433, 'The system', 'may send', 'Intent', 'Return a Result', 'https://developer.android.com/training/basics/intents/filters.html', 'The system may send a given Intent to an activity if that activity has an intent filter fulfills the following criteria of the Intent object: Action A string naming the action to perform.', '11049', '11049_11', '11049_11_1');
INSERT INTO `EntitiesRelation` VALUES (434, 'The Wearable UI Library', 'includes', 'the WearableRecyclerView class', 'Creating Lists', 'https://developer.android.com/training/wearables/ui/lists.html', 'The Wearable UI Library includes the WearableRecyclerView class, which is a RecyclerView implementation for creating lists optimized for wearable devices.', '11325', '11325_4', '11325_4_1');
INSERT INTO `EntitiesRelation` VALUES (435, 'the result', 'is ignored', 'setResult', 'Return a Result', 'https://developer.android.com/training/basics/intents/filters.html', 'If the originating activity had called startActivityForResult() , then the system delivers it the result you supply to setResult() ; otherwise, the result is ignored.', '11049', '11049_50', '11049_50_2');
INSERT INTO `EntitiesRelation` VALUES (436, 'a user', 'reaches', 'bottom', 'Create a custom drawer view', 'https://developer.android.com/training/wearables/ui/wear-ui-library.html', 'For example: By default, the action drawer peeks when a user reaches the top or bottom of the main scrolling content (that is, the view that implements NestedScrollingChild ), whether from normal scrolling or from flings.', '11330', '11330_66', '11330_66_1');
INSERT INTO `EntitiesRelation` VALUES (437, 'an Android Auto user requests playback', 'uses', 'the MediaSession.Callback class', 'Register a media session', 'https://developer.android.com/training/auto/audio/index.html', 'When an Android Auto user requests playback of an audio track from your app, Android Auto uses the MediaSession.Callback class from your app\'s MediaSession object, which it obtained from your app\'s media browse service.', '11027', '11027_118', '11027_118_1');
INSERT INTO `EntitiesRelation` VALUES (438, 'The RequestQueue', 'reading from', 'parsing responses', 'Send a Request', 'https://developer.android.com/training/volley/simple.html', 'The RequestQueue manages worker threads for running the network operations, reading from and writing to the cache, and parsing responses.', '11295', '11295_3', '11295_3_2');
INSERT INTO `EntitiesRelation` VALUES (439, 'The TextPaint object', 'defines', 'text size', 'Rendering complications', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'The TextPaint object defines the font, text size, color, and more.', '11332', '11332_47', '11332_47_1');
INSERT INTO `EntitiesRelation` VALUES (440, 'that ViewGroup', 'provides', 'method', 'Managing Touch Events in a ViewGroup', 'https://developer.android.com/training/gestures/viewgroup.html', 'Note that ViewGroup also provides a requestDisallowInterceptTouchEvent() method.', '11105', '11105_17', '11105_17_1');
INSERT INTO `EntitiesRelation` VALUES (441, 'This intent', 'must be used with', 'startActivityForResult', 'Opening the provider chooser', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'This intent must be used with startActivityForResult().', '11332', '11332_54', '11332_54_1');
INSERT INTO `EntitiesRelation` VALUES (442, 'the CPU', 'would have stalled waiting for', 'a load', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'If the integer division takes less time than one of the loads, we essentially get it for free, since it happens during a period where the CPU would have stalled waiting for a load to complete.', '11020', '11020_324', '11020_324_2');
INSERT INTO `EntitiesRelation` VALUES (443, 'ViewConfiguration methods', 'are', 'getScaledMinimumFlingVelocity', 'Use ViewConfiguration Constants', 'https://developer.android.com/training/gestures/viewgroup.html', 'Two other commonly used ViewConfiguration methods are getScaledMinimumFlingVelocity() and getScaledMaximumFlingVelocity().', '11105', '11105_27', '11105_27_1');
INSERT INTO `EntitiesRelation` VALUES (444, 'Palette.Swatch objects', 'contain', 'color', 'Generate a Palette instance', 'https://developer.android.com/training/material/palette-colors.html', 'Palette.Swatch objects contain the associated color for that profile, as well as the color s population in pixels.', '11149', '11149_53', '11149_53_1');
INSERT INTO `EntitiesRelation` VALUES (445, 'an onView', 'throws', 'AdapterView widgets', 'Adapter view simple test', 'https://developer.android.com/training/testing/espresso/basics.html', 'When an onView() operation throws a NoMatchingViewException and AdapterView widgets are present in the view hierarchy, the most common solution is to use onData().', '11240', '11240_104', '11240_104_3');
INSERT INTO `EntitiesRelation` VALUES (446, 'The Palette class', 'generates', 'Palette.Swatch objects', 'Generate a Palette instance', 'https://developer.android.com/training/material/palette-colors.html', 'The Palette class also generates Palette.Swatch objects for each color profile.', '11149', '11149_52', '11149_52_1');
