INSERT INTO `EntitiesRelation` VALUES (448, 'The system', 'calls', 'the Engine.onDraw', 'Move expensive operations outside the drawing method', 'https://developer.android.com/training/wearables/watch-faces/performance.html', 'The system calls the Engine.onDraw() method every time it redraws your watch face, so you should only include operations that are strictly required to update the watch face inside this method to improve performance.', '11339', '11339_61', '11339_61_1');
INSERT INTO `EntitiesRelation` VALUES (449, 'The AsyncTask method doInBackground', 'runs on', 'the background thread', 'Implementing a Headless Fragment to Encapsulate Network Operations', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'The AsyncTask method doInBackground() then runs on the background thread and calls the downloadUrl() method.', '11053', '11053_39', '11053_39_1');
INSERT INTO `EntitiesRelation` VALUES (450, 'news reader', 'use', 'the IMMERSIVE flag', 'Use Non-Sticky Immersion', 'https://developer.android.com/training/system-ui/immersive.html', 'If you\'re building a book reader, news reader, or a magazine, use the IMMERSIVE flag in conjunction with SYSTEM_UI_FLAG_FULLSCREEN and SYSTEM_UI_FLAG_HIDE_NAVIGATION.', '11228', '11228_35', '11228_35_1');
INSERT INTO `EntitiesRelation` VALUES (451, 'BB', 'will be full at', 'the end', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'At the end of execution, AA and BB will be full of gradually-increasing integers.', '11020', '11020_501', '11020_501_2');
INSERT INTO `EntitiesRelation` VALUES (452, 'the value', 'can get', 'the DISPLAY_NAME', 'Retrieve a File\'s Name and Size', 'https://developer.android.com/training/secure-file-sharing/retrieve-info.html', 'SIZE The size of the file in bytes, as a long This value is the same as the value returned by File.length() The client app can get both the DISPLAY_NAME and SIZE for a file by setting all of the arguments of query() to null except for the content URI.', '11208', '11208_15', '11208_15_1');
INSERT INTO `EntitiesRelation` VALUES (453, 'The WearableRecyclerView class', 'supports', 'wrist gestures', 'Using a Curved Layout to Support Wrist Gestures', 'https://developer.android.com/training/wearables/ui/wrist-gestures.html', 'The WearableRecyclerView class provides a curved layout for lists and automatically supports wrist gestures.', '11331', '11331_18', '11331_18_2');
INSERT INTO `EntitiesRelation` VALUES (454, 'The actions', 'added with', 'WearableExtender.addAction', 'Adding expanded notifications', 'https://developer.android.com/training/wearables/notifications/creating.html', 'The actions added with WearableExtender.addAction() appear only on the wearable and they do not appear on the handheld.', '11318', '11318_79', '11318_79_1');
