INSERT INTO `EntitiesRelation` VALUES (456, 'The Leanback support library', 'provides', 'a BackgroundManager class', 'Update the Background', 'https://developer.android.com/training/tv/playback/browse.html', 'The Leanback support library provides a BackgroundManager class for changing the background of your TV app activity.', '11270', '11270_60', '11270_60_1');
