INSERT INTO `EntitiesRelation` VALUES (460, 'The following layout', 'adds', 'a WearableRecyclerView', 'Creating Lists', 'https://developer.android.com/training/wearables/ui/lists.html', 'The following layout adds a WearableRecyclerView to an activity, so the list is displayed properly on both round and square devices: res/layout/activity_main.xml Then apply the layout to your activity: Creating a Curved Layout.', '11325', '11325_18', '11325_18_1');
INSERT INTO `EntitiesRelation` VALUES (461, 'This information', 'is available in', 'the Location object', 'Request Location Updates', 'https://developer.android.com/training/location/receive-location-updates.html', 'This information, and more, is available in the Location object that your app can retrieve from the fused location provider.', '11139', '11139_8', '11139_8_1');
INSERT INTO `EntitiesRelation` VALUES (462, 'an onView', 'throws', 'AdapterView widgets', 'Checking data loading in adapter views', 'https://developer.android.com/training/testing/espresso/basics.html', 'When an onView() operation throws a NoMatchingViewException and AdapterView widgets are present in the view hierarchy, the most common solution is to use onData().', '11240', '11240_104', '11240_104_3');
