INSERT INTO `EntitiesRelation` VALUES (465, 't', 'want to apply', 'GuidedStepFragment styles', 'Group Guided Steps Into a Guided Sequence', 'https://developer.android.com/training/tv/playback/guided-step.html', 'If your activity already uses a custom theme and you don t want to apply GuidedStepFragment styles to other views in the activity, add the LeanbackGuidedStepTheme_guidedStepTheme attribute to your existing custom activity theme.', '11273', '11273_76', '11273_76_2');
INSERT INTO `EntitiesRelation` VALUES (466, 'the client app', 'calls', 'ContentResolver.getType', 'Retrieve a File\'s MIME Type', 'https://developer.android.com/training/secure-file-sharing/retrieve-info.html', 'To get the data type of a shared file given its content URI, the client app calls ContentResolver.getType().', '11208', '11208_8', '11208_8_1');
