INSERT INTO `EntitiesRelation` VALUES (471, 'Permissions', 'are organized into', 'permission groups', 'Permission Groups', 'https://developer.android.com/training/articles/user-data-overview.html', 'Permissions in Android are organized into permission groups that organize, and group, permissions related to a device\'s capabilities or features.', '11022', '11022_12', '11022_12_1');
INSERT INTO `EntitiesRelation` VALUES (472, 'A File object', 'reading', 'large amounts', 'Saving Files', 'https://developer.android.com/training/basics/data-storage/files.html', 'A File object is suited to reading or writing large amounts of data in start-to-finish order without skipping around.', '11037', '11037_5', '11037_5_1');
INSERT INTO `EntitiesRelation` VALUES (473, 'the view', 'is currently displaying', 'another Snackbar', 'Building and Displaying a Pop-Up Message', 'https://developer.android.com/training/snackbar/showing.html', 'Once you have created the Snackbar , call its show() method to display the Snackbar to the user: The system does not show multiple Snackbar objects at the same time, so if the view is currently displaying another Snackbar , the system queues your Snackbar and displays it after the current Snackbar expires or is dismissed.', '11218', '11218_34', '11218_34_2');
