INSERT INTO `EntitiesRelation` VALUES (645, 'the SearchView', 'can accept', 'the user \'s query', 'Create a Searchable Configuration', 'https://developer.android.com/training/search/setup.html', 'If you run your app now, the SearchView can accept the user\'s query and start your searchable activity with the ACTION_SEARCH intent.', '11205', '11205_29', '11205_29_1');
