INSERT INTO `EntitiesRelation` VALUES (865, 'a method', 'has', 'blocks', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Going further, if a method has two synchronized blocks that lock the same object, and there are no operations in the intervening code that are observable by another thread, the compiler may perform  lock coarsening  and combine them into a single block.', '11020', '11020_388', '11020_388_1');
