INSERT INTO `EntitiesRelation` VALUES (1055, 'First', 'should call', 'setRetainInstance', 'Surviving Configuration Changes', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'To accomplish this, you should make the following modifications to your code: First, your NetworkFragment should call setRetainInstance(true) in its onCreate() method: Then, modify how you initialize the NetworkFragment in your static getInstance() method: Your app can now successfully pull data from the Internet! Note that there are several other background thread management tools that can help you achieve this same goal.', '11053', '11053_50', '11053_50_1');
