INSERT INTO `EntitiesRelation` VALUES (1188, 'Android 4.4 Immersive Mode Android', 'introduces', 'a new SYSTEM_UI_FLAG_IMMERSIVE flag', 'Using Immersive Full-Screen Mode', 'https://developer.android.com/training/system-ui/immersive.html', 'DevBytes: Android 4.4 Immersive Mode Android 4.4 (API Level 19) introduces a new SYSTEM_UI_FLAG_IMMERSIVE flag for setSystemUiVisibility() that lets your app go truly \"full screen.\" This flag, when combined with the SYSTEM_UI_FLAG_HIDE_NAVIGATION and SYSTEM_UI_FLAG_FULLSCREEN flags, hides the navigation and status bars and lets your app capture all touch events on the screen.', '11228', '11228_5', '11228_5_1');
