INSERT INTO `EntitiesRelation` VALUES (1209, 'the events', 'are sent to', 'the parent \'s onTouchEvent', 'Intercept Touch Events in a ViewGroup', 'https://developer.android.com/training/gestures/viewgroup.html', 'If you return true from onInterceptTouchEvent() , the child view that was previously handling touch events receives an ACTION_CANCEL , and the events from that point forward are sent to the parent\'s onTouchEvent() method for the usual handling.', '11105', '11105_10', '11105_10_2');
