INSERT INTO `EntitiesRelation` VALUES (1221, 'the data', 'calls', 'Release', 'Primitive Arrays', 'https://developer.android.com/training/articles/perf-jni.html', 'The code copies the data (for perhaps a second time), then calls Release ; in this case JNI_ABORT ensures there\'s no chance of a third copy.', '11012', '11012_121', '11012_121_1');
INSERT INTO `EntitiesRelation` VALUES (1222, 'the result', 'is', 'non-NULL use GetStringUTFChars', 'Exceptions', 'https://developer.android.com/training/articles/perf-jni.html', 'There are no built-in functions for manipulating the Throwable object itself, so if you want to (say) get the exception string you will need to find the Throwable class, look up the method ID for getMessage \"()Ljava/lang/String;\" , invoke it, and if the result is non-NULL use GetStringUTFChars to get something you can hand to printf(3) or equivalent.', '11012', '11012_139', '11012_139_1');
INSERT INTO `EntitiesRelation` VALUES (1223, 'progress', 'should equal', 'max', 'Display a Fixed-duration Progress Indicator', 'https://developer.android.com/training/notify-user/display-progress.html', 'At the end of the operation, progress should equal max.', '11172', '11172_13', '11172_13_1');
INSERT INTO `EntitiesRelation` VALUES (1224, 'the website owner', 'published', 'https://mobile.example.com/.well-known/assetlinks.json', 'Associating multiple websites with a single app', 'https://developer.android.com/training/app-links/index.html', 'For example, an app with the following intent filter declaration would pass verification only if the website owner published valid assetlinks.json files at both https://www.example.com/.well-known/assetlinks.json and https://mobile.example.com/.well-known/assetlinks.json : Declare Website Associations.', '11002', '11002_48', '11002_48_4');
