INSERT INTO `EntitiesRelation` VALUES (1232, 'the attestationSecurityLevel element', 'is set to', 'the TrustedEnvironment security level', 'Key Attestation', 'https://developer.android.com/training/articles/security-key-attestation.html', 'To do so, you should check that the attestation certificate chain contains a root certificate that is signed with the Google attestation root key and that the attestationSecurityLevel element within the key description data structure is set to the TrustedEnvironment security level.', '11017', '11017_4', '11017_4_2');
INSERT INTO `EntitiesRelation` VALUES (1233, 'the TextView', 'contains', 'the item', 'Adapter view simple test', 'https://developer.android.com/training/testing/espresso/basics.html', 'The goal of this test is to open the Spinner , select a specific item, and verify that the TextView contains the item.', '11240', '11240_84', '11240_84_2');
INSERT INTO `EntitiesRelation` VALUES (1234, 'test', 'has obtained', 'a UiObject object', 'Accessing UI Components', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'Once your test has obtained a UiObject object, you can call the methods in the UiObject class to perform user interactions on the UI component represented by that object.', '11255', '11255_80', '11255_80_1');
