INSERT INTO `EntitiesRelation` VALUES (1241, 'a store', 'causes', 'something', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The fact that a store in thread 1 causes something to happen in thread 2 which causes something to happen in thread 3 does not mean that thread 3 will observe the stores in that order.', '11020', '11020_222', '11020_222_1');
