INSERT INTO `EntitiesRelation` VALUES (1245, 'a store', 'will be observed in', 'order', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'While the architecture guarantees that loads are not reordered with respect to other loads, and stores are not reordered with respect to other stores, it does not guarantee that a store followed by a load will be observed in the expected order.', '11020', '11020_52', '11020_52_3');
