INSERT INTO `EntitiesRelation` VALUES (1248, 'way', 'is to use', 'the UiModeManager.getCurrentModeType', 'Check for a TV Device', 'https://developer.android.com/training/tv/start/hardware.html', 'The recommended way to determine if your app is running on a TV device is to use the UiModeManager.getCurrentModeType() method to check if the device is running in television mode.', '11280', '11280_10', '11280_10_1');
