INSERT INTO `EntitiesRelation` VALUES (1251, 'C++ language standards', 'are evolving to include', 'a sophisticated collection', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The C and C++ language standards are evolving to include a sophisticated collection of atomic operations.', '11020', '11020_475', '11020_475_1');
