INSERT INTO `EntitiesRelation` VALUES (1254, 'the Fragment', 'Add', 'a ViewPager', 'Create the Fragment', 'https://developer.android.com/training/animation/screen-slide.html', 'Create the Views Create the Fragment Add a ViewPager Customize the Animation with PageTransformer Try it out.', '10997', '10997_1', '10997_1_1');
INSERT INTO `EntitiesRelation` VALUES (1255, 'the News Reader app \'s HeadlinesFragment', 'does precisely for', 'example', 'Reuse Fragments in Other Activities', 'https://developer.android.com/training/multiscreen/adaptui.html', 'You can usually do that by defining an interface that abstracts all the ways in which the fragment needs to interact with its host activity, and then the host activity implements that interface: For example, the News Reader app\'s HeadlinesFragment does precisely that: Then, when the user selects a headline, the fragment notifies the listener specified by the host activity (as opposed to notifying a specific hard-coded activity): This technique is discussed further in the guide to Supporting Tablets and Handsets.', '11167', '11167_21', '11167_21_5');
INSERT INTO `EntitiesRelation` VALUES (1256, 'that FLAG_SECURE', 'stop', 'firing', 'Source app', 'https://developer.android.com/training/articles/assistant.html', 'Note that FLAG_SECURE does not cause the Assist API callbacks to stop firing.', '11008', '11008_54', '11008_54_2');
INSERT INTO `EntitiesRelation` VALUES (1257, 'the Contacts Provider', 'join between', 'the ContactsContract.Data table', 'Set up a projection', 'https://developer.android.com/training/contacts-provider/retrieve-details.html', 'This column is available in the ContactsContract.Data table, because the Contacts Provider makes an implicit join between the ContactsContract.Contacts table and the ContactsContract.Data table.', '11077', '11077_11', '11077_11_3');
INSERT INTO `EntitiesRelation` VALUES (1258, 'The system', 'does not show', 'multiple Snackbar objects', 'Creating a Snackbar object', 'https://developer.android.com/training/snackbar/showing.html', 'Once you have created the Snackbar , call its show() method to display the Snackbar to the user: The system does not show multiple Snackbar objects at the same time, so if the view is currently displaying another Snackbar , the system queues your Snackbar and displays it after the current Snackbar expires or is dismissed.', '11218', '11218_34', '11218_34_1');
INSERT INTO `EntitiesRelation` VALUES (1259, 'the compiler', 'could move', 'a non-volatile load', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Non-volatile accesses may be reorded with respect to volatile accesses in the usual ways, for example the compiler could move a non-volatile load or store  above  a volatile store, but couldn t move it  below .', '11020', '11020_396', '11020_396_1');
