INSERT INTO `EntitiesRelation` VALUES (1261, 'a camera app', 'might list', 'CAMERA', 'Consider Using an Intent', 'https://developer.android.com/training/permissions/usage-notes.html', 'For example, a camera app might list CAMERA , READ_CONTACTS , and ACCESS_FINE_LOCATION in its manifest.', '11180', '11180_72', '11180_72_1');
