INSERT INTO `EntitiesRelation` VALUES (1264, 'this IntentService', 'gets', 'tests', 'Handle Geofence Transitions', 'https://developer.android.com/training/location/geofencing.html', 'When the user clicks the notification, the app\'s main activity appears: After detecting the transition event via the PendingIntent , this IntentService gets the geofence transition type and tests whether it is one of the events the app uses to trigger notifications -- either GEOFENCE_TRANSITION_ENTER or GEOFENCE_TRANSITION_EXIT in this case.', '11137', '11137_46', '11137_46_3');
INSERT INTO `EntitiesRelation` VALUES (1265, 'custom content rating schemes TvInputManager', 'manages', 'the interaction', 'Define your TV input service', 'https://developer.android.com/training/tv/tif/tvinput.html', 'TvInputService provides long-running and background availability for the TV input TvInputService.Session maintains the TV input state and communicates with the hosting app TvContract describes the channels and programs available to the TV input TvContract.Channels represents information about a TV channel TvContract.Programs describes a TV program with data such as program title and start time TvTrackInfo represents an audio, video, or subtitle track TvContentRating describes a content rating, allows for custom content rating schemes TvInputManager provides an API to the system TV app and manages the interaction with TV inputs and apps.', '11289', '11289_71', '11289_71_7');
