INSERT INTO `EntitiesRelation` VALUES (1270, 'game', 'calls', 'an InputManagerCompat method', 'Add an Interface for Backward Compatibility', 'https://developer.android.com/training/game-controllers/compatibility.html', 'If your game is running on Android 4.1 or higher and calls an InputManagerCompat method, the proxy implementation calls the equivalent method in InputManager.', '11095', '11095_58', '11095_58_1');
INSERT INTO `EntitiesRelation` VALUES (1271, 'some themes', 'set', 'an ActionBar', 'Adding the App Bar', 'https://developer.android.com/training/appbar/index.html', 'There are other ways to implement an app bar for example, some themes set up an ActionBar as an app bar by default but using the appcompat Toolbar makes it easy to set up an app bar that works on the widest range of devices, and also gives you room to customize your app bar later on as your app develops.', '11005', '11005_11', '11005_11_1');
