INSERT INTO `EntitiesRelation` VALUES (1994, 'This setting', 'prevents', 'the GLSurfaceView frame', 'Build a GLSurfaceView Object', 'https://developer.android.com/training/graphics/opengl/environment.html', 'The essential code for a GLSurfaceView is minimal, so for a quick implementation, it is common to just create an inner class in the activity that uses it: One other optional addition to your GLSurfaceView implementation is to set the render mode to only draw the view when there is a change to your drawing data using the GLSurfaceView.RENDERMODE_WHEN_DIRTY setting: This setting prevents the GLSurfaceView frame from being redrawn until you call requestRender() , which is more efficient for this sample app.', '11107', '11107_27', '11107_27_2');
