INSERT INTO `EntitiesRelation` VALUES (1996, 'the Safetynet API \'s SafetyNet.SafetyNetApi.attest', 'verify', 'the integrity', 'nonce)', 'Abuse detection: Identifying bots and DDoS attacks', 'You can verify that a request comes from a genuine Android device (as opposed to an emulator or other code spoofing another device) using the Safetynet API\'s SafetyNet.SafetyNetApi.attest(mGoogleApiClient, nonce) method to verify the integrity of a device making a request.', '11021', '11021_158', '11021_158_1');
