INSERT INTO `EntitiesRelation` VALUES (2162, 'the result', 'is', 'non-NULL use GetStringUTFChars', 'UTF-8 and UTF-16 Strings', 'https://developer.android.com/training/articles/perf-jni.html', 'There are no built-in functions for manipulating the Throwable object itself, so if you want to (say) get the exception string you will need to find the Throwable class, look up the method ID for getMessage \"()Ljava/lang/String;\" , invoke it, and if the result is non-NULL use GetStringUTFChars to get something you can hand to printf(3) or equivalent.', '11012', '11012_139', '11012_139_1');
