INSERT INTO `EntitiesRelation` VALUES (2164, 'users', 'click', 'the QuickContactBadge icon', 'Set the Contact URI', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'For example: When users click the QuickContactBadge icon, the contact\'s details automatically appear in the dialog.', '11074', '11074_31', '11074_31_1');
