INSERT INTO `EntitiesRelation` VALUES (2169, 'The system', 'does not show', 'multiple Snackbar objects', 'Use a CoordinatorLayout', 'https://developer.android.com/training/snackbar/showing.html', 'Once you have created the Snackbar , call its show() method to display the Snackbar to the user: The system does not show multiple Snackbar objects at the same time, so if the view is currently displaying another Snackbar , the system queues your Snackbar and displays it after the current Snackbar expires or is dismissed.', '11218', '11218_34', '11218_34_1');
INSERT INTO `EntitiesRelation` VALUES (2170, 'The service', 'uses', 'a Geocoder', 'Define an intent service to fetch the address', 'https://developer.android.com/training/location/display-address.html', 'The service uses a Geocoder to fetch the address for the location and sends the results to the ResultReceiver.', '11136', '11136_31', '11136_31_1');
