INSERT INTO `EntitiesRelation` VALUES (2173, 'the originating activity', 'had called', 'startActivityForResult', 'Add an Intent Filter', 'https://developer.android.com/training/basics/intents/filters.html', 'If the originating activity had called startActivityForResult() , then the system delivers it the result you supply to setResult() ; otherwise, the result is ignored.', '11049', '11049_50', '11049_50_1');
