INSERT INTO `EntitiesRelation` VALUES (2175, 'the system', 'assumes as', 'GestureDetector.SimpleOnGestureListener', 'Detecting a Subset of Supported Gestures', 'https://developer.android.com/training/gestures/detector.html', 'If you return false from onDown() , as GestureDetector.SimpleOnGestureListener does by default, the system assumes that you want to ignore the rest of the gesture, and the other methods of GestureDetector.OnGestureListener never get called.', '11099', '11099_53', '11099_53_1');
