INSERT INTO `EntitiesRelation` VALUES (2178, 'activity layout', 'contains', 'TabHost', 'Create a Version-Aware Activity Layout', 'https://developer.android.com/training/backward-compatible-ui/using-component.html', 'For the older implementation ( TabHelperEclair ), you need to ensure that your activity layout contains a TabWidget and TabHost , along with a container for tab contents: res/layout/mainxml: For the TabHelperHoneycomb implementation, all you need is a FrameLayout to contain the tab contents, since the tab indicators are provided by the ActionBar : res/layout-v11/mainxml: At runtime, Android will decide which version of the main.xml layout to inflate depending on the platform version.', '11035', '11035_7', '11035_7_2');
