INSERT INTO `EntitiesRelation` VALUES (2306, 'BasicNetwork', 'provides', 'a network transport', 'Set Up a Network and Cache', 'https://developer.android.com/training/volley/requestqueue.html', 'There are standard implementations of these available in the Volley toolbox: DiskBasedCache provides a one-file-per-response cache with an in-memory index, and BasicNetwork provides a network transport based on your preferred HTTP client.', '11294', '11294_7', '11294_7_2');
