INSERT INTO `EntitiesRelation` VALUES (2309, 'an app', 'calls', 'startActivityForResult', 'Return a Result', 'https://developer.android.com/training/basics/intents/filters.html', 'When an app calls startActivity() or startActivityForResult() , with an implicit intent, the system finds which activity (or activities) can respond to the intent.', '11049', '11049_8', '11049_8_2');
